import { uniq } from 'lodash';
import { ADD_STOCKS } from '../actionType';

const stocks = (state = [], action) => {
  switch (action.type) {
    case ADD_STOCKS:
      uniq(action.data, value => {
        console.log(value);
        return true;
      });
      return (
        action.data.map(d => {
          console.log('d=====', d[0]);
          state.map(s => {
            console.log(s[0] === d[0]);
          });
          return [...d, new Date()];
        }) || state
      );
    default:
      return state;
  }
};

export default stocks;
